import React, { useState } from 'react';
import Button from '@mui/material/Button'; // Import the Button component from Material-UI
import './prompt.css';

const Prompt = () => {
    const [prompt, setPrompt] = useState('');
    const [image, setImage] = useState('');

    const handleSubmit = (event: React.FormEvent) => {
        event.preventDefault();
        console.log(prompt);
    };

    const handleVerify = () => {
        console.log('Verification started.');
    };

    return (
        <div className="prompt-container">
            <h2>Prompt:</h2>
            <form onSubmit={handleSubmit}>
                <textarea value={prompt} onChange={e => setPrompt(e.target.value)} />
                <Button variant="contained" color="primary" type="submit">Enter</Button> {/* Use Material-UI button */}
            </form>
            <div className="image-box">
                {image && <img src={`data:image/png;base64,${image}`} alt="Generated" />}
            </div>
            <Button variant="contained" color="secondary" onClick={handleVerify}>Verify</Button> {/* Use Material-UI button */}
        </div>
    );
};

export default Prompt;
